import React from "react";
import { Link } from "wouter";
import "./GIF.css"

export default function Gif({title, id , url , keyword}){

    return (
        <div className="Gif">

        <h1> {title}</h1>
        <p> {id }</p>
        <Link to={`/gif/${id}`}>
        <img src={url} alt="-"/>
        </Link>
        </div>
       ) 



}
